/* global global, Office, self, window */

Office.onReady(() => {
  // If needed, Office.js is ready to be called
});

const imageBase64 = "";
const stylesDocumentBase64 = "";
const templateDocumentBase64 = "";

async function autorun(event) {
  Word.run(async (context) => {
    context.document.insertFileFromBase64(templateDocumentBase64, "Replace", {
          importTheme: true,
          importStyles: true,
          importParagraphSpacing: true,
          importPageColor: true,
          importChangeTrackingMode: true,
          importCustomProperties: true,
          importCustomXmlParts: true,
          importDifferentOddEvenPages: true
        });
    await context.sync();

    const retrievedStyles = context.application.retrieveStylesFromBase64(stylesDocumentBase64);
    await context.sync();
    context.document.importStylesFromJson(retrievedStyles.value);
    await context.sync();

    const style = context.document.getStyles().getByNameOrNullObject("NewNormalStyle");
    style.load();
    await context.sync();
    if(!style.isNullObject){
      context.document.body.style = "NewNormalStyle";
    }
    await context.sync();

    context.document.body.insertInlinePictureFromBase64(imageBase64, "Start");
    await context.sync();

    const header = context.document.sections.getFirst().getHeader(Word.HeaderFooterType.primary);
    const firstPageHeader = context.document.sections.getFirst().getHeader(Word.HeaderFooterType.firstPage);
    header.clear();
    firstPageHeader.clear();
    header.insertParagraph("High Confidential - The data must be secret or in some way highly critical", "Start");
    firstPageHeader.insertParagraph(
      "High Confidential - The data must be secret or in some way highly critical",
      "Start"
    );
    header.font.color = "#f8334d";
    firstPageHeader.font.color = "#f8334d";

    await context.sync();
  });

  // Calling event.completed is required. event.completed lets the platform know that processing has completed.
  event.completed();
}

Office.actions.associate("autorun", autorun);